import React from 'react';
import PrivcyPolicy from './Pages/PrivcyPolicy'


import {BrowserRouter as Router} from 'react-router-dom';



const App = () => {
  return <>
  <Router>
  <Route path='/Pric' element={<Cart/>}></Route>
    <PrivcyPolicy/>
  </Router>
  </>;
};

export default App;
